import logo from './logo.svg';
import './App.css';
import React from 'react';
import { Card, Space } from 'antd';
import fruitsData from "./fruit.json";
const { Meta } = Card;

function App() {

  const fruits = fruitsData.map((item) => (
      <Card
      style={{
        width: 300,
        margin: 20,
        padding: 0,
      }}
      cover={
        <img
          alt="example"
          src={item.image}
        />
      }
    >
      <Meta
        title={item.name}
        description="Price: {item.price}"
      />
      </Card>
      ));

  return (
    <div className="App">
      <header className="App-header">
        <h1> Fruit Market</h1>
      </header>
      <div id="grid"> 

        <Space wrap> 
          <Card
            style={{
              width: 300,
              margin: 20,
              padding: 0,
            }}
            cover={
              <img
                alt="example"
                src="https://i.pinimg.com/474x/3c/e6/81/3ce6812fc4e7e730ba7544af78aff465.jpg"
              />
            }
          >
            <Meta
              title="Strawberries"
              description="$3.99"
            />
          </Card>
          <Card
            style={{
              width: 300,
              margin: 20,
              padding: 0,
            }}
            cover={
              <img
                alt="example"
                src="https://i.pinimg.com/474x/b5/ac/eb/b5aceb5ed08466ed1a3898aeef8aa634.jpg"
              />
            }
          >
            <Meta
              title="Blueberries"
              description="$4.99"
            />
          </Card>
          <Card
            style={{
              width: 300,
              margin: 20,
              padding: 0,
            }}
            cover={
              <img
                alt="example"
                src="https://i.pinimg.com/474x/cc/f2/a6/ccf2a62d89c0bc33880e119c9f576a17.jpg"
              />
            }
          >
            <Meta
              title="Cherries"
              description="$7.99"
            />
          </Card>
          <Card
            style={{
              width: 300,
              margin: 20,
              padding: 0,
            }}
            cover={
              <img
                alt="example"
                src="https://i.pinimg.com/474x/49/a2/e0/49a2e042efab81cf13780fda7d1a84b4.jpg"
              />
            }
          >
            <Meta
              title="Apples"
              description="$1.99"
            />
          </Card>
          <Card
            style={{
              width: 300,
              margin: 20,
              padding: 0,
            }}
            cover={
              <img
                alt="example"
                src="https://i.pinimg.com/474x/9b/36/23/9b3623915b76ac44081cf0aa4d3f149c.jpg"
              />
            }
          >
            <Meta
              title="Persimmon"
              description="$4.99"
            />
          </Card>
          <Card
            style={{
              width: 300,
              margin: 20,
              padding: 0,
            }}
            cover={
              <img
                alt="example"
                src="https://i.pinimg.com/474x/82/90/ac/8290ac4c2cb5c7e1fb624fb254d6e549.jpg"
              />
            }
          >
            <Meta
              title="Green Grapes"
              description="$4.99"
            />
          </Card>
          <Card
            style={{
              width: 300,
              margin: 20,
              padding: 0,
            }}
            cover={
              <img
                alt="example"
                src="https://i.pinimg.com/474x/49/0f/1f/490f1ff215b2781088087f8bff30a0f7.jpg"
              />
            }
          >
            <Meta
              title="Watermelon"
              description="$3.99"
            />
          </Card>
          <Card
            style={{
              width: 300,
              margin: 20,
              padding: 0,
            }}
            cover={
              <img
                alt="example"
                src="https://i.pinimg.com/474x/fe/68/b7/fe68b7439dbaf2197a57b59b94f77ccf.jpg"
              />
            }
          >
            <Meta
              title="Blackberries"
              description="$3.99"
            />
          </Card>
          <Card
            style={{
              width: 300,
              margin: 20,
              padding: 0,
            }}
            cover={
              <img
                alt="example"
                src="https://i.pinimg.com/474x/f9/0c/88/f90c8853af89bcaf9b8d070317a999b0.jpg"
              />
            }
          >
            <Meta
              title="Peaches"
              description="$3.99"
            />
          </Card>
          <Card
            style={{
              width: 300,
              margin: 20,
              padding: 0,
            }}
            cover={
              <img
                alt="example"
                src="https://i.pinimg.com/474x/b8/07/54/b8075493ab6e35538571a9312bde2a80.jpg"
              />
            }
          >
            <Meta
              title="Oranges"
              description="$3.99"
            />
          </Card>
          <Card
            style={{
              width: 300,
              margin: 20,
              padding: 0,
            }}
            cover={
              <img
                alt="example"
                src="https://i.pinimg.com/474x/18/fc/ae/18fcae75abf011baf795754260e9bb65.jpg"
              />
            }
          >
            <Meta
              title="Mangoes"
              description="$3.99"
            />
          </Card>
          <Card
            style={{
              width: 300,
              margin: 20,
              padding: 0,
            }}
            cover={
              <img
                alt="example"
                src="https://i.pinimg.com/474x/3b/b1/fb/3bb1fb3211295388843b9bf866fe2397.jpg"
              />
            }
          >
            <Meta
              title="Pear"
              description="$3.99"
            />
          </Card>
        </Space>


      </div>
    </div>
  );
}

export default App;
